import React from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import './pages/Connected.js';
//import {Connected} from './pages/Connected';
import Routes from './Routes';
import Login from './pages/Login';
import {Connected} from "./pages/Connected";


function App() {
    return(
        <>
            <Routes/>
           <Login/>
           <Connected/>
        </>
    );
}
export default App;
